schemaDefinition: "create or replace view SF_MIGRATION_SCHEMA_STATS_V(\n\tRECORD_ID,\n\
  \tSF_ACCOUNT,\n\tSF_DATABASE,\n\tSOURCE_SCHEMA,\n\tTABLES_FOUND,\n\tTABLES_MISSING,\n\
  \tCREATED_TIMESTAMP\n) as\nSELECT RECORD_ID,\n    SF_ACCOUNT,\n\tSF_DATABASE,\n\t\
  SOURCE_SCHEMA,\n\tTABLES_FOUND,\n\tTABLES_MISSING,\n\tCREATED_TIMESTAMP\nFROM (\n\
  \    SELECT RECORD_ID,\n    SF_ACCOUNT,\n\tSF_DATABASE,\n\tSOURCE_SCHEMA,\n\tTABLES_FOUND,\n\
  \tTABLES_MISSING,\n\tCREATED_TIMESTAMP,\n           ROW_NUMBER() OVER (PARTITION\
  \ BY SF_ACCOUNT,SF_DATABASE,SOURCE_SCHEMA ORDER BY created_timestamp DESC) AS rn\n\
  \    FROM SF_MIGRATION_SCHEMA_STATS\n) AS subquery\nWHERE rn = 'random';"
